    import React from 'react'

    const Hits = ({ hits }) => {
      const data = [
        { id: 1, name: "John Doe" },
        { id: 2, name: "Victor Wayne" },
        { id: 3, name: "Jane Doe" },
      ];
      return (
        <div>
          <center><h1>Contact List</h1></center>
          {data.map((hit) => (
            <div class="card">
              <div class="card-body">
                <h5 class="card-title">{hit.name}</h5>
                <h6 class="card-subtitle mb-2 text-muted">{hit}</h6>

              </div>
            </div>
          ))}
        </div>
      )
    };

    export default Hits
